的时代，这也是一个怀疑的时代。这是光明的季节，这也是黑暗的季节。但你们已经展现出这种品质和勇气去帮忙你们度过这个风云变幻的时代。最重要的是，你已表现出坚毅。这是我最近经常想到的一句话，这是我心中的英雄之一。罗斯福说过:你将获得力量，勇气和信心。如果你在过往的经验中， 每次都能真的停下来，直面恐惧。你就能对自己说，我已经渡过这次难关。并且你能够应对接下来发生的事。那就是坚毅。这非常重要，因为每个人，每个人都有被打倒的时候。你是否能站起来继续往前走。\"}],\"raw_message\":\"这是一个很好的时代，这也是一个很坏的时代。但它依然会继续。这是一个智慧的时代，这也是一个愚蠢的时代。这是信仰的时代，这也是一个怀疑的时代。这是光明的季节，这也是黑暗的季节。但你们已经展现出这种品质和勇气去帮忙你们度过这个风云变幻的时代。最重要的是，你已表现出坚毅。这是我最近经常想到的一句话，这是我心中的英雄之一。罗斯福说过:你将获得力量，勇气和信心。如果你在过往的经验中， 每次都能真的停下来，直面恐惧。你就能对自己说，我已经渡过这次难关。并且你能够应对接下来发生的事。那就是坚毅。这非常重要，因为每个人，每个人都有被打倒的时候。你是否能站起来继续往前走。\",\"message_type\":\"group\",\"sender\":{\"user_id\":278359100,\"nickname\":\"李佳琪\",\"card\":\"\",\"sex\":\"male\",\"age\":95,\"area\":\"\",\"level\":5,\"role\":\"member\",\"title\":\"\"},\"group_id\":977891079,\"group_name\":\"前端开发Vue\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1841031740}','帮忙',1,'2023-09-25 12:02:05',NULL),(3240,'2023925205256163','{\"post_type\":\"message\",\"message_id\":\"ByjuKjNhcO8ABdz6YCQJJ2URgqcB\",\"user_id\":862023919,\"time\":1695646375,\"seq\":384250,\"rand\":1612974375,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"问下，多啦宝和银联前置开户还需要花钱啊？\"}],\"raw_message\":\"问下，多啦宝和银联前置开户还需要花钱啊？\",\"message_type\":\"group\",\"sender\":{\"user_id\":862023919,\"nickname\":\"小蝌蚪\",\"card\":\"\",\"sex\":\"male\",\"age\":3,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":120122922,\"group_name\":\"PHP学习交流群\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1841031740}','花钱',1,'2023-09-25 12:52:56',NULL),(3241,'2023925212614100','{\"post_type\":\"message\",\"message_id\":\"MPEwMDQqi/IAAKwxkbigymURinYB\",\"user_id\":875203570,\"time\":1695648374,\"seq\":44081,\"rand\":2444796106,\"font\":\"微软雅黑\",\"message\":[{\"type\":\"text\",\"text\":\"付费写一个简单页面，适应电脑端和手机端，有时间的私聊我\"}],\"raw_message\":\"付费写一个简单页面，适应电脑端和手机端，有时间的私聊我\",\"message_type\":\"grou