me\":1695688212,\"seq\":23433,\"rand\":1453925523,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\"}],\"raw_message\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\",\"message_type\":\"group\",\"sender\":{\"user_id\":3368671649,\"nickname\":\"科技\",\"card\":\"\",\"sex\":\"unknown\",\"age\":0,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":736134060,\"group_name\":\"小程序APP网站开发\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1531400736}','联系我',1,'2023-09-26 00:30:12',NULL),(3245,'20239268477123','{\"post_type\":\"message\",\"message_id\":\"MvhkBV9RJIUADzcNc/OZAWUSKgsB\",\"user_id\":1599153285,\"time\":1695689227,\"seq\":997133,\"rand\":1945344257,\"font\":\"微软雅黑\",\"message\":[{\"type\":\"text\",\"text\":\"以下是一份8天的前端学习计划，旨在帮助你在国庆假期充分系统性地学习前端技术，实现弯道超车：\\r\\rDay 1: HTML\\r- 学习HTML基础知识，包括标签、属性和常用元素。\\r- 创建一个简单的HTML页面，包括标题、段落、列表、链接等元素。\\r\\rDay 2: CSS\\r- 掌握CSS基础知识，包括选择器、盒模型和常见样式属性。\\r- 使用CSS美化前一天创建的HTML页面，添加样式和布局。\\r\\rDay 3: JavaScript Basics\\r- 学习JavaScript的基本概念，包括变量、数据类型和运算符。\\r- 编写一些简单的JavaScript代码，如计算器或提示框。\\r\\rDay 4: JavaScript DOM Manipulation\\r- 学习JavaScript中的DOM操作，掌握如何使用JavaScript与HTML文档进行交互。\\r- 实践一些常见的DOM操作，例如动态创建元素、修改样式和处理事件。\\r\\rDay 5: Responsive Web Design\\r- 了解响应式网页设计的原理和方法，学习使用CSS媒体查询和其他技术实现响应式布局。\\r- 修改之前的HTML页面，使其能够在不同设备上适应不同屏幕尺寸。\\r\\rDay 6: Front-End Frameworks\\r- 介绍常见的前端框架，如React、Vue或Angular。\\r- 选择一个框架进行深入学习，并完成一个小型项目或示例应用。\\r\\rDay 7: Web Accessibility\\r- 了解Web可访问性的重要性和原则。\\r- 修改之前的HTML页面，使其符合基本的可访问性标准，如添加合适的语义化标签和描述性文本。\\r\\rDay 8: Project Work and Recap\\r- 使用所学知识，独立完成一个小型前端项目。\\r- 复习前几天的内容，巩固所学知识，并解决遇到的问题。\\r你可以根据自己的实际情况和学习进度进行调整。记得在学习过程中保持实践和反复练习，这样才能更好地掌握前端技术。祝你国庆假期学习愉快，取得进步！\"}],\"raw_message\":\"以下是一份8天的前端学习计划，旨在帮助你在国庆假期充分系统性地学习前端技术，实现弯道超车：\\r\\rDay 1: HTML\\r- 学习HTML基础知识，包括标签、属性和常用元素。\\r- 创建一个简单的HTML页面，包括标题、段落、列表、链接等元素。\\r\\rDay 2: CSS\\r- 掌握CSS基础知识，包括选择器、盒模型和常见样式属性。\\r- 使用CSS美化前一天创建的HTML页面，添加样式和布局。\\r\\rDay 3: JavaScript Basics\\r- 学习JavaScript的基本概念，包括变量、数据类型和运算符。\\r- 编写一些简单的JavaScript代码，如计算器或提示框。\\r\\rDay 4: JavaScript DOM Manipulation\\r- 学习JavaScript中的DOM操作，掌握如何使用JavaScript与HTML文档进行交互。\\r- 实践一些常见的DOM操作，例如动态创建元素、修改样式和处理事件。\\r\\rDay 5: Responsive Web Design\\r- 了解响应式网页设计的原理和方法，学习使用CSS媒体查询和其他技术实现响应式布局。\\r- 修改之前的HTML页面，使其能够在不同设备上适应不同屏幕尺寸。\\r\\rDay 6: Front-End Frameworks\\r- 介绍常见的前端框架，如React、Vue或Angular。\\r- 选择一个框架进行深入学习，并完成一个小型项目或示例应用。\\r\\rDay 7: Web Accessibility\\r- 了解Web可访问性的重要性和原则。\\r- 修改之前的HTML页面，使其符合基本的可访问性标准，如添加合适的语义化标签和描述性文本。\\r\\rDay 8: Project Work and Recap\\r- 使用所学知识，独立完成一个小型前端项目。\\r- 复习前几天的内容，巩固所学知识，并解决遇到的问题。\\r你可以根据自己的实际情况和学习进度进行调整。记得在学习过程中保持实践和反复练习，这样才能更好地掌握前端技术。祝你国庆假期学习愉快，取得进步！\",\"message_type\":\"group\",\"sender\":{\"user_id\":1599153285,\"nickname\":\"相聚有时\",\"card\":\"\",\"sex\":\"male\",\"age\":23,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":855139333,\"group_name\":\"小满vue3 pinia 官方群\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1841031740}','帮助',1,'2023-09-26 00:47:07',NULL),(3246,'202392691039111','{\"post_type\":\"message\",\"message_id\":\"K+CDrMjJ2aEAAFuLbI9jBmUSL48B\",\"user_id\":3368671649,\"time\":1695690639,\"seq\":23435,\"rand\":1821336326,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\"}],\"raw_message\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\",\"message_type\":\"group\",\"sender\":{\"user_id\":3368671649,\"nickname\":\"科技\",\"card\":\"\",\"sex\":\"male\",\"age\":29,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":736134060,\"group_name\":\"小程序APP网站开发\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1531400736}','联系我',1,'2023-09-26 01:10:39',NULL),(3247,'202392691039155','{\"post_type\":\"message\",\"message_id\":\"K+CDrMjJ2aEAAFuLbI9jBmUSL48B\",\"user_id\":3368671649,\"time\"