message_id\":\"K+CDrMjJ2aEAAF2QaJlSYWUfsxUB\",\"user_id\":3368671649,\"time\":1696576277,\"seq\":23952,\"rand\":1754878561,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\"}],\"raw_message\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\",\"message_type\":\"group\",\"sender\":{\"user_id\":3368671649,\"nickname\":\"科技\",\"card\":\"\",\"sex\":\"male\",\"age\":29,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":736134060,\"group_name\":\"小程序APP网站开发\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1841031740}','联系我',1,'2023-10-06 07:11:16',NULL),(3636,'2023106151116111','{\"post_type\":\"message\",\"message_id\":\"K+CDrMjJ2aEAAF2QaJlSYWUfsxUB\",\"user_id\":3368671649,\"time\":1696576277,\"seq\":23952,\"rand\":1754878561,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\"}],\"raw_message\":\"承接小程序网站开发100一张多做多便宜 需要的联系我就行\",\"message_type\":\"group\",\"sender\":{\"user_id\":3368671649,\"nickname\":\"科技\",\"card\":\"\",\"sex\":\"male\",\"age\":29,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":736134060,\"group_name\":\"小程序APP网站开发\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1531400736}','联系我',1,'2023-10-06 07:11:16',NULL),(3637,'2023106155954135','{\"post_type\":\"message\",\"message_id\":\"NzcfwDBN6MgABRneF1zkLmUfvnsB\",\"user_id\":810412232,\"time\":1696579195,\"seq\":334302,\"rand\":391963694,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"关于科汉森的具体产品，大多是上述益生菌的组合和配比改进，以期达到功效。当然也有很多用于发酵食品生产的商业化发酵剂等产品，如FeelGood Kefir系列的eXact ® Kefir1/2、Yoflex ®等菌种（蕴含14种活性菌株）用于开菲尔的生产，产品具有清爽/浓郁的口味，柔滑的质地，也体现了益生菌的益生功能。YoFlex ® Acidifix™菌种具备与众不同的pH值稳定性，可为酸奶生产模式带来全新变革，同时可大幅度降低成本。Viniflora ®直投式菌种精选自能够控制苹果酸-乳酸发酵的酒类酒球菌，不需要再适应环境、再复水、再培养的步骤。Viniflora ® Freasy ™CH16在葡萄酒行业中素以高质量、高性能和低成本著称，可在高pH值、高酒精含量的葡萄酒中进行苹果酸-乳酸发酵，并且在苹果酸-乳酸发酵中不会产生组胺，从而帮助酿酒师生产出更易饮用的葡萄酒。去年科汉森推出了可消耗半乳糖产葡萄糖的Sweety®菌种，可以最大化地利用了牛奶中的乳糖，将不怎么甜的乳糖变成了相对较甜的葡萄糖，故生产商可以添加更少的糖来获得原来的甜度。欧美的品牌在没有牺牲口味的情况下利用Sweety®宣称对比市场平均减掉了30%的糖分（当然和原料奶也有关系，乳糖含量越高，额外糖添加就越少）。在植物基食品的生产方面，科汉森推出了nu-trish ® LGG ® DA、nu-trish ® BB-12 ® DA两款产品。科汉森青贮乳酸菌SiloSolve ® FC包含两株独特的菌种组合——乳酸乳球菌O-224和布氏乳杆菌LB1819，针对性解决青贮发酵前期营养物质耗损和开窖后有氧稳定性的问题。\\n\\n今年六月，科汉森宣布5.3亿美元收购UAS Labs，故其旗下的益生菌又多了Lactobacillus acidophilusDDS®-1、Bifidobacterium lactisUABla-12™（缓解偶尔的腹泻或便秘，改善排便，减少偶尔的腹胀）、Lactobacillus reuteri NCIMB 30242（调节总胆固醇水平、LDL-胆固醇水平、维生素D的产生、保持健康的hs-CRP和纤维蛋白原水平，调节消化健康）、Lactobacillus gasseriBNR17™（从母乳中分离的，具有控制体重、改善体内脂肪质量、帮助改善腰围和臀围、利于消化）、Lactobacillus plantarumPPLP-217™（利于婴幼儿生长发育、调节消化系统促进健康的免疫系统、促进呼吸道健康）、ProDURA® Bacillus coagulans（调节消化健康和肠道菌群平衡、免疫调节、调节女性阴道的健康、调节口腔健康）。\"}],\"raw_message\":\"关于科汉森的具体产品，大多是上述益生菌的组合和配比改进，以期达到功效。当然也有很多用于发酵食品生产的商业化发酵剂等产品，如FeelGood Kefir系列的eXact ® Kefir1/2、Yoflex ®等菌种（蕴含14种活性菌株）用于开菲尔的生产，产品具有清爽/浓郁的口味，柔滑的质地，也体现了益生菌的益生功能。YoFlex ® Acidifix™菌种具备与众不同的pH值稳定性，可为酸奶生产模式带来全新变革，同时可大幅度降低成本。Viniflora ®直投式菌种精选自能够控制苹果酸-乳酸发酵的酒类酒球菌，不需要再适应环境、再复水、再培养的步骤。Viniflora ® Freasy ™CH16在葡萄酒行业中素以高质量、高性能和低成本著称，可在高pH值、高酒精含量的葡萄酒中进行苹果酸-乳酸发酵，并且在苹果酸-乳酸发酵中不会产生组胺，从而帮助酿酒师生产出更易饮用的葡萄酒。去年科汉森推出了可消耗半乳糖产葡萄糖的Sweety®菌种，可以最大化地利用了牛奶中的乳糖，将不怎么甜的乳糖变成了相对较甜的葡萄糖，故生产商可以添加更少的糖来获得原来的甜度。欧美的品牌在没有牺牲口味的情况下利用Sweety®宣称对比市场平均减掉了30%的糖分（当然和原料奶也有关系，乳糖含量越高，额外糖添加就越少）。在植物基食品的生产方面，科汉森推出了nu-trish ® LGG ® DA、nu-trish ® BB-12 ® DA两款产品。科汉森青贮乳酸菌SiloSolve ® FC包含两株独特的菌种组合——乳酸乳球菌O-224和布氏乳杆菌LB1819，针对性解决青贮发酵前期营养物质耗损和开窖后有氧稳定性的问题。\\n\\n今年六月，科汉森宣布5.3亿美元收购UAS Labs，故其旗下的益生菌又多了Lactobacillus acidophilusDDS®-1、Bifidobacterium lactisUABla-12™（缓解偶尔的腹泻或便秘，改善排便，减少偶尔的腹胀）、Lactobacillus reuteri NCIMB 30242（调节总胆固醇水平、LDL-胆固醇水平、维生素D的产生、保持健康的hs-CRP和纤维蛋白原水平，调节消化健康）、Lactobacillus gasseriBNR17™（从母乳中分离的，具有控制体重、改善体内脂肪质量、帮助改善腰围和臀围、利于消化）、Lactobacillus plantarumPPLP-217™（利于婴幼儿生长发育、调节消化系统促进健康的免疫系统、促进呼吸道健康）、ProDURA® Bacillus coagulans（调节消化健康和肠道菌群平衡、免疫调节、调节女性阴道的健康、调节口腔健康）。\",\"message_type\":\"group\",\"sender\":{\"user_id\":810412232,\"nickname\":\"上善若水\",\"card\":\"精通嫪毐转轮之术的细狗\",\"sex\":\"male\",\"age\":28,\"area\":\"上海\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":926359488,\"group_name\":\"Java技术交流\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1531400736}','帮助',1,'2023-10-06 07:59:54',NULL),(3638,'202310616734142','{\"post_type\":\"message\",\"message_id\":\"EKv/Z1aeo2kABcTPTYRjYmUfwEcB\",\"user_id\":1453237097,\"time\":1696579655,\"seq\":378063,\"rand\":1300521826,\"font\":\"宋体\",\"message\":[{\"type\":\"text\",\"text\":\"国庆节花钱如流水啊\"}],\"raw_message\":\"国庆节花钱如流水啊\",\"message_type\":\"group\",\"sender\":{\"user_id\":1453237097,\"nickname\":\"Mr.GooRit\",\"card\":\"我欲成仙, 快乐无边\",\"sex\":\"unknown\",\"age\":0,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":279707495,\"group_name\":\"web前端(Html,Vue,React)4\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1758193468}','花钱',1,'2023-10-06 08:07:34',NULL),(3639,'202310616249188','{\"post_type\":\"message\",\"message_id\":\"MK1Y683QJi4AAtYjL8c7RGUfxCkB\",\"user_id\":3452970542,\"time\":1696580649,\"seq\":185891,\"rand\":801585988,\"font\":\"宋体\",\"message\":[{\"type\":\"at\",\"qq\":1206462108,\"text\":\"@知一必行，知行必一\"},{\"type\":\"text\",\"text\":\" 屁事一堆，快来解决问题\"}],\"raw_message\":\"@知一必行，知行必一 屁事一堆，快来解决问题\",\"message_type\":\"group\",\"sender\":{\"user_id\":3452970542,\"nickname\":\"Cascading Style Sheets\",\"card\":\"\",\"sex\":\"unknown\",\"age\":0,\"area\":\"\",\"level\":1,\"role\":\"member\",\"title\":\"\"},\"group_id\":816666859,\"group_name\":\"node.js开发技术交流\",\"block\":false,\"sub_type\":\"normal\",\"anonymous\":null,\"atme\":false,\"atall\":false,\"group\":{},\"member\":{},\"self_id\":1841031740}','解决问题',1,'2023-10-06 08:24:09',NULL),(3640,'2023106163256159','{\"post_type\":\"message\",\"message_id\":\"J/kqF5uQSzgAAa3TLZlBtWUfxjkB\",\"user_id\":2609924920,